import React, { useState } from 'react';
import { render } from 'react-dom';
import './style.css';
import { Simples, Composto, Main } from './convJuros.js';
import { CompoundInterest } from './jurosComp.js';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/';

export function Component0() {
  return (
    <a>
      Oi
    </a>
  );
}

export function Component1() {
  return (
    <p>
      <Main/>
    </p>
  );
}

export function Component2() {
  return (
    <p>
      <CompoundInterest/>
    </p>
  );
}

export default function Home() {
  const [comp2Render, setComp2Render] = useState(0);

  return (
    <div>
      <header>
        <div class="container" />
        <div id="logo">
          <img src="logo.png" alt="texto" height="400" width="400" />
        </div>
      </header>
      <div class="containerCentro1">
        <div class="containerCentro2">
          <div id="menu">

            <div className="App">
              <button onClick={() => setComp2Render(1)}>Interest Converter</button>
              <button onClick={() => setComp2Render(2)}>Compound Interest Converter</button>
            </div>

          </div>
        </div>
      </div>
      <div id="principal">

        <div class="efeito">

          <div class="container">

            <div>
              {comp2Render === 1 && (
                <Component1 />
              )}
              {comp2Render === 2 && (
                <Component2 />
              )}
            </div>

          </div>
        </div>
      </div>
      <footer>Developed by Lucas Marinho</footer>
    </div>
  )
}



render(<Home />, document.getElementById('root'));
